        private IComplexRepository _complexRepository;
        private ISchoolRepository _schoolRepository;
        private IItemRepository _itemRepository;
        private IRepository<AppSeting> _appSetingRepository;
        public SchoolsController(IComplexRepository complexRepository, IItemRepository itemRepository, ISchoolRepository schoolRepository, IRepository<AppSeting> appSetingRepository)
        {
            this._complexRepository = complexRepository;
            this._schoolRepository = schoolRepository;
            this._itemRepository = itemRepository;
            this._appSetingRepository = appSetingRepository;
        }
        // GET: Schools
        [ScreenPermissionFilter(screenId = 17)]
        public ActionResult Index(int? page)
        {
            try
            {
                if (Session["UserInfo"] != null)
                {
                    var ModelList = _schoolRepository.GetAllschoolWithComplex().OrderBy(x => x.Id);
                    int pageSize = 20;
                    //set page to one is there is no value, ??  is called the null-coalescing operator.
                    int pageNumber = (page ?? 1);
                    //return the Model data with paged
                    return View(ModelList.ToPagedList(pageNumber, pageSize));
                }
                else
                {
                    return RedirectToAction("Login", "Account");
                }
            }
            catch (Exception)
            {


                return RedirectToAction("Index", "Home");
            }


        }

        public ActionResult Test()
        {
            try
            {
                if (Session["UserInfo"] != null)
                {
                    var ModelList = _schoolRepository.GetAllschoolWithComplex().OrderBy(x => x.Id).ToList();

                    return View(ModelList);
                }
                else
                {
                    return RedirectToAction("Login", "Account");
                }
            }
            catch (Exception)
            {


                return RedirectToAction("Index", "Home");
            }


        }

        // GET: Schools/Details/5
        [ScreenPermissionFilter(screenId = 18)]
        public ActionResult Details(int id)
        {
            try
            {
                if (id == null)
                {
                    return new HttpStatusCodeResult(HttpStatusCode.BadRequest);
                }
                School school = _schoolRepository.GetschoolWithComplexById(id);
                if (school == null)
                {
                    return HttpNotFound();
                }
                return View(school);
            }
            catch (Exception)
            {
                return RedirectToAction("Index");
            }

        }

        // GET: Schools/Create
        [ScreenPermissionFilter(screenId = 19)]
        public ActionResult Create()
        {
            try
            {
                ViewBag.sch_comp_id = new SelectList(_complexRepository.GetAll(), "Id", "comp_arName");
                return View();

            }
            catch (Exception)
            {

                return RedirectToAction("Index");
            }

        }

