        [ScreenPermissionFilter(screenId = 20)]
        public ActionResult Edit(int? id)
        {
            try
            {
                if (id == null)
                {
                    return new HttpStatusCodeResult(HttpStatusCode.BadRequest);
                }
                School school = _schoolRepository.GetByNum(id);
