            }
            catch (Exception)
            {
                return RedirectToAction("Index");
            }

        }


        // POST: Schools/Edit/5
        // To protect from overposting attacks, enable the specific properties you want to bind to, for 
        // more details see https://go.microsoft.com/fwlink/?LinkId=317598.
        [HttpPost]
        [ValidateAntiForgeryToken]
        public ActionResult Edit([Bind(Include = "Id,sch_arName,sch_enName,sch_phon,sch_email,sch_address,sch_comp_id,IsAvtive,sch_type,sch_department,sch_laboratoryRecordName,sch_image")] School school, HttpPostedFileBase sch_image)
        {
            try
            {
                if (ModelState.IsValid)
                {
                    school.ModifiedDate = Convert.ToDateTime(DateTime.Now.ToString("yyyy/MM/dd"));
                    if ((User)Session["UserInfo"] != null)
                    {
                        User oUser = (User)Session["UserInfo"];
                        school.ModifiedBy = oUser.Id;
                    }
                    else
                    {
                        return RedirectToAction("Login", "Account");
                    }
                    if (sch_image != null)
                    {
                        byte[] bytes = null;
                        using (var binaryReader = new BinaryReader(sch_image.InputStream))
                        {
                            bytes = binaryReader.ReadBytes(sch_image.ContentLength);
                        }
                        school.sch_image = bytes;
                    }
                    //else
                    //{
                    //    school.sch_image= (byte[])_schoolRepository.GetByNum(school.Id).sch_image;
                    //}

                    _schoolRepository.Update(school);
                    return RedirectToAction("Index");
                }
                ViewBag.sch_comp_id = new SelectList(_complexRepository.GetAll(), "Id", "comp_arName", school.sch_comp_id);
                return View(school);
            }
            catch (Exception)
            {

                return RedirectToAction("Index");
            }

        }

